DROP DATABASE IF EXISTS pr;
CREATE DATABASE pr;
USE pr;

CREATE TABLE mytable(
   FIELD1                    INTEGER  NOT NULL PRIMARY KEY 
  ,artists                   VARCHAR(37) NOT NULL
  ,albums                    VARCHAR(67) NOT NULL
  ,artist_links              VARCHAR(74) NOT NULL
  ,album_links               VARCHAR(137) NOT NULL
  ,label                     VARCHAR(33) NOT NULL
  ,release_country           VARCHAR(23)
  ,total_artist_albums       NUMERIC(6,1)
  ,first_release_links       VARCHAR(117) NOT NULL
  ,number_of_songs           NUMERIC(4,1) NOT NULL
  ,average_song_length       NUMERIC(18,16)
  ,users_have                NUMERIC(7,1) NOT NULL
  ,users_want                NUMERIC(7,1) NOT NULL
  ,user_rating               NUMERIC(4,2) NOT NULL
  ,median_price              NUMERIC(6,2)
  ,styles                    VARCHAR(120) NOT NULL
  ,genres                    VARCHAR(70) NOT NULL
  ,number_for_sale           NUMERIC(5,1)
  ,versions                  NUMERIC(5,1) NOT NULL
  ,spotify_monthly_listeners NUMERIC(10,1)
  ,time_since_sold           NUMERIC(6,1)
  ,years_after_first_album   NUMERIC(4,1)
  ,years_since_any_album     NUMERIC(4,1)
  ,years_since_release       NUMERIC(4,1)
  ,Classic_Rock              BIT  NOT NULL
  ,Pop_Rock                  BIT  NOT NULL
  ,Prog_Rock                 BIT  NOT NULL
  ,Heavy_Metal               BIT  NOT NULL
  ,Folk                      BIT  NOT NULL
  ,New_Wave                  BIT  NOT NULL
  ,Electronic                BIT  NOT NULL
  ,Hip_Hop                   BIT  NOT NULL
  ,Blues                     VARCHAR(5) NOT NULL
  ,Jazz                      BIT  NOT NULL
  ,Funk                      BIT  NOT NULL
  ,Soundtrack                BIT  NOT NULL
);
